import React, { Component } from "react";
import "./App.css";
import "./Title.css";

class Title extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { text, x, y } = this.props;

    const maskStyle = {
      "--maskX": x,
      "--maskY": y
    };

    const { srcImg } = this.props;
    return (
      <div
        className="titleContainer"
        onMouseMove={this.props._onMouseMove}
        onMouseOut={this.props._onMouseOut}
        ref="titleContainer"
        style={maskStyle}
      >
        <div className="titleWrapper">
          <h2>{text}</h2>
        </div>
        <div className="titleWrapper cloneWrapper">
          <h2>{text}</h2>
        </div>
      </div>
    );
  }
}

export default Title;
